import React from 'react';
import { createGlobalStyle } from 'styled-components';
import TodoTemplate from './TodoTemplate';

const GlobalStyle = createGlobalStyle`
  body{
    background: #000000;
  }
`;

function App() {
  return (
    <>
      <GlobalStyle/>
      <TodoTemplate>안녕하세요</TodoTemplate>
    </>
  );
}

export default App;
